import React, { Component } from "react";
import Post from "./Post";
import "./styles.scss";

export class Explore extends Component {
  constructor(props) {
    super(props);

    const post = [
      {
        id: 1,
        title: "paris",
        desc: "beautiful",
      },
      {
        id: 2,
        title: "chicago",
        desc: "busy",
      },
    ];

    this.state = {
      posts: post,
    };
  }

  render() {
    return (
      <div className="card-container">
        <h1>Explore</h1>
        {this.state.posts.map((p) => (
          <Post></Post>
        ))}
      </div>
    );
  }
}

export default Explore;
